 <p>
 Parse the error response using {@link #parse(JsonFactory, HttpResponse)}. Sample usage:
 </p>

 <pre>
    try {
      request.execute();
    } catch (HttpResponseException e) {
        GoogleJsonError errorResponse = GoogleJsonError.parse(factory, e.response);
        System.err.println(errorResponse.code + " Error: " + errorResponse.message);
        for (ErrorInfo error : errorResponse.errors) {
          System.err.println(factory.toString(error));
        }
    } catch (IOException e) {
...
    }
 </pre>

 @since 1.4
 @author Yaniv Inbar

method.doc:
     Returns a new instance of {@link GoogleJsonResponseException}.

<p>
If there is a JSON error response, it is parsed using {@link GoogleJsonError}, which can be
inspected using {@link #getDetails()}. Otherwise, response content (if any) is read and
ignored. Either way, any content is already parsed, and trying to parse
{@link HttpResponse#getContent()} of {@link #getResponse()} will likely result in an
{@link IOException}.
</p>

@param jsonFactory JSON factory
@param response HTTP response
@return new instance of {@link GoogleJsonResponseException}

constructor.doc:
     @param jsonFactory JSON factory to use
@param data JSON key name/value data
@since 1.5

class.doc:
   Serializes JSON-C content based on the data key/value mapping object for an item, wrapped in a
{@code "data"} envelope.

<p>
Warning: this should only be used by some older Google APIs that wrapped the response in a {@code
"data"} envelope. All newer Google APIs don't use this envelope, and for those APIs
{@link JsonHttpContent} should be used instead.
</p>

<p>
Sample usage:
</p>

<pre>
<code>
 static void setContent(HttpRequest request, Object data) {
   JsonCContent content = new JsonCContent();
   content.jsonFactory = new JacksonFactory();
   content.data = data;
   request.content = content;
 }
</code>
</pre>

